essentials/dynamic-matching.html.body:
Matching din√°mico de rutas
Es bastante com√∫n tener que mapear rutas con un patr√≥n determinado al mismo componente. Por ejemplo, puede que tengamos un componente User el cual deber√≠a ser renderizado para todos los usuarios, pero con diferente ID. En vue-router podemos usar un segmento din√°mico en el path para lograrlo:
const User = {
  template: 'User'
}

const router = new VueRouter({
  routes: [
    // los segmentos din√°micos comienzan con dos puntos
    { path: '/user/:id', component: User }
  ]
})

Ahora, las URL como /user/foo y /user/bar mapear√°n a la misma ruta.
Un segmento din√°mico se representa mediante dos puntos :. Cuando se encuentra una coincidencia en la ruta, el valor del segmento din√°mico se expondr√° como this.$route.params en cada componente. Por lo tanto, podremos renderizar el ID del usuario actual modificando el template de Userde la siguiente manera:
const User = {
  template: 'User {{ $route.params.id }}'
}

Puedes consultar el siguiente ejemplo.
Se pueden tener m√∫ltiples segmentos din√°micos en la misma ruta, y todos ser√°n mapeados a los correspondientes campos en $route.params. Por ejemplo:



patr√≥n
matching de ruta
