Adem√°s de $route.params, el objeto $route expone m√°s informaci√≥n √∫til, como $route.query (si hay alguna query en la URL), $route.hash, etc. Puedes verificar todos los detalles en la documentaci√≥n de la API.
Reaccionando ante cambios de los par√°metros
Una cosa a tener en cuenta cuando se usan rutas con par√°metros es que cuando el usuario navega de /user/foo a /user/bar, la misma instancia del componente ser√° reutilizada. Dado que ambas rutas renderizan el mismo componente, esto es m√°s eficiente que destruir la instancia anterior y crear una nueva. Sin embargo, esto significa que los hooks del ciclo de vida del componentes no ser√°n emitidos.
Para detectar cambios en los par√°metros en el mismo componente, puedes observar el objeto $route:
const User = {
  template: '...',
  watch: {
    '$route' (to, from) {
      // C√≥digo que responde al cambio
    }
  }
}

O utiliza el guardia de navegaci√≥n beforeRouteUpdate introducido en la versi√≥n 2.2:
const User = {
  template: '...',
  beforeRouteUpdate (to, from, next) {
    // C√≥digo que responde al cambio
    // no olvides ejecutar next()
  }
}

Patrones de matching avanzados
vue-router usa path-to-regexp como su motor de b√∫squeda de patrones, por lo que soporta varios patrones de matching avanzados tales como segmentos din√°micos opcionales, requerimientos del tipo cero o m√°s / uno o m√°s, e incluso patrones regex personalizados. Verifica la  documentaci√≥n para estos patrones avanzados, y este ejemplo de como usarlos con vue-router.
Prioridad en el matching de patrones
A veces la misma URL puede coincidir con m√∫ltiples rutas. En ese caso, la prioridad se determina por el orden de la definici√≥n de las rutas: la primera ruta definida ser√° la que tenga mayor prioridad.

essentials/nested-routes.html.body:
Sub-rutas
Las interfaces de usuario (UI por sus siglas en ingl√©s) de aplicaciones reales normalmente est√°n compuestas por componentes que est√°n anidados varios niveles. Es tambi√©n muy com√∫n que los segmentos de una URL correspondan a cierta estructura de componentes anidados, por ejemplo:
/user/foo/profile                     /user/foo/posts
+------------------+                  +-----------------+
| User             |                  | User            |
| +--------------+ |                  | +-------------+ |
| | Profile      | |  +------------>  | | Posts       | |
| |              | |                  | |             | |
| +--------------+ |                  | +-------------+ |
+------------------+                  +-----------------+
Con vue-router es muy sencillo expresar esta relaci√≥n usando configuraciones de sub-rutas.
Dada la aplicaci√≥n que creamos en el cap√≠tulo anterior:




const User = {
  template: 'User {{ $route.params.id }}'
}

const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User }
  ]
})

Aqu√≠,  es un contenedor de nivel superior. Renderiza el componente que coincida con una ruta de nivel superior. As√≠, un componente renderizado puede contener su propio  anidado. Por ejemplo, si agregamos uno dentro de la plantilla del componente User:
const User = {
  template: `

      User {{ $route.params.id }}


  `
}

Para renderizar componentes dentro de este contenedor anidado, necesitamos usar la opci√≥n children en la configuraci√≥n del constructor de VueRouter:
const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User,
      children: [
        {
          // UserProfile ser√° renderizado en el  dentro de User
          // cuando /user/:id/profile coincida
          path: 'profile',
          component: UserProfile
        },
        {
          // UserPosts ser√° renderizado en el  dentro de User
          // cuando /user/:id/posts coincida
          path: 'posts',
          component: UserPosts
        }
      ]
    }
  ]
})

Nota que las sub-rutas que empiecen con / ser√°n tratadas como absolutas. Esto permite aprovechar el anidamiento de componentes sin tener que usar URL anidadas.
Como puedes ver, la opci√≥n children es simplemente otro array de objetos de configuraci√≥n de rutas, como routes. Por lo tanto, puedes anidar tantas vistas como necesites.
En este punto, con la configuraci√≥n anterior, cuando visites /user/foo, nada ser√° renderizado dentro del contenedor de  User porque ninguna sub ruta coincidi√≥. Tal vez quieras renderizar algo ah√≠. En ese caso, puedes pasar una sub ruta vac√≠a:
const router = new VueRouter({
  routes: [
    {
      path: '/user/:id', component: User,
      children: [
        // UserHome ser√° renderizado en el  dentro de User
        // cuando /user/:id coincida
        { path: '', component: UserHome },

        // ...otras sub rutas
