  props: ['id'],
  template: 'User {{ id }}'
}
const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User, props: true }

    // utilizando vistas con nombre, tienes que definir la opci√≥n prop para cada una de ellas:
    {
      path: '/user/:id', 
