Esto te permite utilizar el componente en cualquier lugar, lo cual hace al mismo reutilizable y m√°s sencillo de testear.
Modo boolean
Cuando props tiene asignado el valor true, route.params ser√°n asignados como las props del componente.
Modo objeto
Cuando props es un objeto, este ser√° asignado tal cual como las props del componente.
