  routes: [
    { path: '/search', component: SearchUser, props: (route) => ({ query: route.query.q }) }
  ]
})

La URL: /search?q=vue pasar√≠a {query: "vue"} como props al componente SearchUser.
Intenta crear funciones props sin estado, dado que solo se eval√∫an cuando ocurren cambios de ruta.
