advanced/navigation-guards.html.body:
Guardias de navegaci√≥n
Como el nombre sugiere, las guardias de navegaci√≥n provistas por vue-router son b√°sicamente utilizadas para proteger rutas de navegaci√≥n ya sea redireccionando o cancel√°ndolas. Hay varias maneras de engancharse en el proceso de navegaci√≥n de rutas: globalmente, por ruta o dentro de los componentes.
Recuerda: Los cambios en los par√°metros o las queries no har√°n que se ejecuten los guardias de navegaci√≥n. Simplemente observa el objeto $route para poder reaccionar frente a esos cambios o utiliza el guardia beforeRouteUpdate en el componente.
Guardias globales
Puedes registrar guardias before globales utilizando router.beforeEach:
const router = new VueRouter({ ... })

router.beforeEach((to, from, next) => {
  // ...
})

Las guardias before globales son llamadas por orden de creaci√≥n, cuando una navegaci√≥n comienza. Las guardias pueden ejecutarse asincr√≥nicamente, y la navegaci√≥n se considera pendiente hasta que todos los hooks sean resueltos. 
Cada funci√≥n guardia recibe tres argumentos:

to: Route: el Objeto Route hacia donde se navega.

from: Route: la ruta actual desde la cual se navega.

next: Function: esta funci√≥n debe ser ejecutada para resolver el hook. La acci√≥n a realizar depende de los argumentos provistos a next:

next(): moverse al siguiente hook en la cadena. Si no queda ninguno, la navegaci√≥n se confirma.

next(false): cancelar la navegaci√≥n actual. Si la URL en el navegador cambi√≥ (ya sea manualmente o a trav√©s del bot√≥n atr√°s), ser√° reseteada al valor de la ruta from.

next('/') o next({ path: '/' }): redirecciona a una ruta diferente. La navegaci√≥n actual ser√° abortada y una nueva ser√° iniciada.

next(error): (2.4.0+) si el argumento pasado a next es una instancia de Error, la navegaci√≥n se abortar√° y el error ser√° pasado a las funciones callback registradas a trav√©s de router.onError().




Aseg√∫rese de llamar siempre a la funci√≥n next, sino el hook nunca ser√° resuelto.
Guardias de resoluci√≥n globales

Nuevo en 2.5.0

A partir de la versi√≥n 2.5.0 puedes registrar un guardia global con router.beforeResolve. Esto es similar a router.beforeEach, con la diferencia que los guardias de resoluci√≥n ser√°n llamados justo antes de que la navegaci√≥n sea confirmada, despu√©s que todos los guardias en el componente y los componentes de rutas as√≠ncronos sean resueltos.
Post hooks globales
Tambi√©n puedes registrar hooks globales que se ejecutar√°n despu√©s de que la navegaci√≥n sea confirmada. Sin embargo, a diferencia de los guardias, estos hooks no reciben una funci√≥n next y no pueden afectar la navegaci√≥n:
router.afterEach((to, from) => {
  // ...
})

Guardias por ruta
Puedes definir guardias beforeEnter directamente en el objeto de configuraci√≥n de una ruta:
const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      beforeEnter: (to, from, next) => {
        // ...
      }
    }
  ]
})

Estos guardias tienen exactamente la misma firma que los guardias before globales.
Guardias en componentes
Por √∫ltimo, puedes directamente definir guardias de navegaci√≥n dentro de los componentes de ruta (los que son pasados a la configuraci√≥n del router) con las siguientes opciones:

beforeRouteEnter
beforeRouteUpdate (agregado en la versi√≥n 2.2)
beforeRouteLeave

const Foo = {
  template: `...`,
  beforeRouteEnter (to, from, next) {
    // se llama antes que la ruta que renderiza este componente sea confirmada.
    // NO tiene acceso a la instancia del componente `this`,
    // ¬°porque no ha sido creada todav√≠a cuando este guardia es ejecutado!
  },
  beforeRouteUpdate (to, from, next) {
    // se llama cuando la ruta que renderiza este componente ha cambiado,
    // pero este componente es reusado en la nueva ruta.
    // Por ejemplo, para una ruta con par√°metros din√°micos /foo/:id, cuando
    // navegamos desde /foo/1 havia /foo/2, la misma instancia del componente Foo
    // ser√° reusada, y este _hook_ ser√° llamado cuando eso suceda.
    // Tiene acceso a la instancia del componente `this`
  },
  beforeRouteLeave (to, from, next) {
    // se llama cuando la ruta que renderiza el componente est√° por ser
    // abandonada.
    // Tiene acceso a la instancia del componente `this`
  }
}

La guardia beforeRouteEnter NO tiene acceso a this, porque es ejecutada antes que la navegaci√≥n sea confirmada, por lo tanto el componente destino todav√≠a no ha sido creado.
Sin embargo, puedes acceder a la instancia pasando una funci√≥n callback a next. La funci√≥n callback se ejecutar√° cuando la navegaci√≥n sea confirmada, y la instancia del componente ser√° pasada como argumento:
beforeRouteEnter (to, from, next) {
  next(vm => {
    // accede a la instancia del componente a trav√©s de `vm`
  })
}

Puedes acceder directamente a this dentro de beforeRouteLeave. La guardia leave se utiliza normalmente para prevenir al usuario cuando intenta abandonar la ruta accidentalmente sin guardar cambios. La navegaci√≥n puede ser cancelada ejecutando next(false).
El flujo de resoluci√≥n de navegaci√≥n completo

Se dispara la navegaci√≥n.
Se llaman a los guardias leave en los componentes desactivados.
Se llaman a los guardias beforeEach globales.
Se llaman a los guardias beforeRouteUpdate en los componentes reutilizados (2.2+).
Se llama a beforeEnter en las configuraciones de rutas.
Se resuelven componentes de rutas as√≠ncronos.
Se llama a beforeRouteEnter en los componentes activados.
Se llama a los guardias globales beforeResolve (2.5+).
Se confirma la navegaci√≥n.
Se llaman a los hook globalesafterEach.
Se disparan las actualizaciones del DOM.
Se llaman a las funciones callback pasadas a next en los guardias beforeRouteEnter con las instancias creadas.

advanced/meta.html.body:
Campos Meta en las rutas
Puedes incluir un campo meta cuando definas una ruta:
const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      children: [
        {
          path: 'bar',
          component: Bar,
          // campo meta
          meta: { requiresAuth: true }
        }
      ]
    }
  ]
})

Entonces, ¬øcomo accedemos al campo meta?
Primero, cada objeto route en la configuraci√≥n de routes se llama registro de ruta. Los registros de ruta pueden estar anidados. Por lo tanto, cuando una ruta coincida, existe la posibilidad que lo haga con m√°s de un registro de ruta.
Por ejemplo, con la configuraci√≥n anterior, la URL /foo/bar coincidir√° tanto con el registro de ruta padre como con el hijo.
Todos los registros de rutas que hayan coincidido son expuestos en el objeto $route (y tambi√©n a los objetos route en las guardias de navegaci√≥n) como el array $route.matched. Por ende, necesitaremos iterar sobre $route.matched para verificar campos meta en los registros de rutas.
Un caso de uso de ejemplo es verificar la existencia de campos metas en los guardias de navegaci√≥n global:
router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.requiresAuth)) {
    // esta ruta requiere autenticaci√≥n, verificamos que haya iniciado sesi√≥n
    // sino, redirigimos a la p√°gina de inicio de sesi√≥n.
    if (!auth.loggedIn()) {
      next({
        path: '/login',
        query: { redirect: to.fullPath }
      })
    } else {
      next()
    }
  } else {
    next() // ¬°Aseg√∫rate de ejecutar next siempre!
  }
})

