advanced/data-fetching.html.body:
Obtenci√≥n de datos
A veces es necesario obtener datos del servidor cuando una ruta es activada. Por ejemplo, antes de renderizar un perfil de usuario, puedes obtener la informaci√≥n de ese usuario desde el servidor. Podemos lograr esto de dos maneras diferentes:

Obtener la informaci√≥n despu√©s de la navegaci√≥n: realiza la navegaci√≥n primero y luego obt√©n los datos en un hook del ciclo de vida del componente entrante. Puedes mostrar un indicador de carga mientras se obtienen los datos.

Obtener la informaci√≥n antes de la navegaci√≥n: Obt√©n los datos antes de la navegaci√≥n en la guardia de entrada de la ruta, y realiza la navegaci√≥n una vez estos obtenidos.


T√©cnicamente, ambas opciones son v√°lidas - todo depende de la experiencia de usuario a la que apuntes.
Obtener la informaci√≥n despu√©s de la navegaci√≥n
Cuando utilizamos este enfoque, navegamos y renderizamos el componente entrante inmediatamente, y obtenemos los datos en el hook created del componente. Esto nos permite mostrar un indicador de estado de carga mientras se obtiene la informaci√≥n desde un servidor remoto, y tambi√©n manejar la carga de datos seg√∫n la ruta.
Asumamos que tenemos un componente Post que necesita obtener datos de un post bas√°ndose en $route.params.id:



