El usuario permanecer√° en la vista anterior mientras se est√© obteniendo el recurso para la vista entrante. Por lo tanto, es recomendable mostrar alg√∫n tipo de indicador o barra de progreso. Si la obtenci√≥n de datos falla, es necesario mostrar alg√∫n tipo de advertencia global.

