Comportamiento del scroll
Cuando se utiliza enrutamiento del lado cliente, podemos querer hacer scroll hacia el inicio de la p√°gina cuando naveguemos a una nueva ruta, o preservar la posici√≥n actual, tal cual lo hace una recarga de la p√°gina. vue-router te permite lograr esto e incluso m√°s: permite personalizar completamente el comportamiento del scroll durante la navegaci√≥n.
Nota: esta caracter√≠stica solo funciona en el modo historial de HTML5.
Cuando crees una instancia del router, puedes incluir la funci√≥n scrollBehavior:
const router = new VueRouter({
  routes: [...],
  scrollBehavior (to, from, savedPosition) {
    // devolver la posici√≥n deseada
  }
})

La funci√≥n scrollBehavior recibe los objetos de ruta to y from. El tercer par√°metro, savedPosition, solo est√° disponible si estamos en una navegaci√≥n popstate (cuando se utilizan los botones atr√°s o adelante en el navegador).
La funci√≥n puede devolver un objeto de posici√≥n de scroll. El objeto puede ser de la forma:

{ x: number, y: number }
{ selector: string, offset? : { x: number, y: number }} (offset solo soportado a partir de la versi√≥n 2.6.0+)

Si se devuelve un valor falso o un objeto vacio, no ocurrir√° ning√∫n desplazamiento.
Por ejemplo:
