  return { x: 0, y: 0 }
}

Esto har√° que la p√°gina se desplace hacia el inicio para todas las navegaciones a la ruta.
Devolver savedPosition har√° que el comportamiento cuando se utilicen los botones atr√°s o adelante sea el nativo:
scrollBehavior (to, from, savedPosition) {
  if (savedPosition) {
    return savedPosition
  } else {
    return { x: 0, y: 0 }
  }
}

Si deseas simular el scroll hacia anclas:
