El objeto Route
Un objeto Route representa el estado de la ruta activa actualmente. Contiene informaci√≥n analizada de la URL actual y los registros de rutas que coinciden con ella.
El objeto Route es inmutable. Cada navegaci√≥n exitosa resultar√° en un nuevo objeto Route.
El objeto Route puede encontrarse en diferentes lugares.

Dentro de los componentes, como this.$route

Dentro de las funciones callbacks de observaci√≥n de $route

Como valor de retorno de la funci√≥n router.match(location)

Dentro de las guardias de navegaci√≥n como los primeros dos argumentos:
router.beforeEach((to, from, next) => {
  // to y from son objetos de ruta
})


Dentro de la funci√≥n scrollBehaviorcomo los primeros dos argumentos:
const router = new VueRouter({
  scrollBehavior (to, from, savedPosition) {
    // to y from son objetos de ruta
  }
})



Propiedades del objeto Route

$route.path

tipo: string
Una cadena de texto equivalente a la ruta actual, siempre resuelta como una ruta absoluta. Por ejemplo"/foo/bar".



$route.params

tipo: Object
Un objeto que contiene pares llave/valor de segmentos din√°micos y segmentos estrella. Si no hay parametros, el valor ser√° un objeto vacio.



$route.query

tipo: Object
Un objeto que contiene pares llave/valor del query string. Por ejemplo, para la ruta /foo?user=1, obtendremos $route.query.user == 1. Si no hay query string el valor ser√° un objeto vacio.



$route.hash

tipo: string
El hash de la ruta actual (con la #), si posee. Si no hay un hash el valor ser√° una cadena de texto vacia.



$route.fullPath

tipo: string
La URL completa incluyendo query y hash.



$route.matched

tipo: Array

Un array que contiene registros de ruta para todos los segmentos anidados de la ruta actual. Los registros de ruta son copias de los objetos en el array de configuraci√≥n routes (y en los arrays children):
const router = new VueRouter({
  routes: [
    // el siguiente objeto es un registro de ruta
    { path: '/foo', component: Foo,
      children: [
        // este tambi√©n es un registro de ruta
        { path: 'bar', component: Bar }
      ]
    }
  ]
})

Cuando la URL es /foo/bar, $route.matched ser√° un array que contendr√° ambos objetos (clonados), en orden descendente de padre a hijo.

$route.name
El nombre de la ruta acutal, si tiene. (M√°s informaci√≥n en rutas con nombre)
